import React, { useState } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
import { useNavigate } from "react-router-dom";

function Login() {

  let navigate = useNavigate();
  const [user, setUser] = useState({
    phone: "",
    password: "",
  });
  const { phone, password } = user;
  const inputchanges = (e) => {
    setUser({ ...user, [e.traget.name]: e.traget.value });
  };
  const submitForm = async (e) => {
    e.preventDefault();
    await axios.post("http://localhost:8080/contacts/new", user);
    navigate("/");
  };

  return (
    <div className="container">
      <div>
        <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
          <div className="container-fluid">
            <a className="navbar-brand"></a>
            <button
              className="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarSupportedContent"
              aria-controls="navbarSupportedContent"
              aria-expanded="false"
              aria-label="Toggle navigation"
            >
              <span className="navbar-toggler-icon"></span>
            </button>
            <Link className="btn btn-outline-light" to="/new">
              New User
            </Link>{" "}
          </div>
        </nav>
      </div>
      <br />
      <div className="row">
        <div className="col-md-6 offset-md-3 broder rounder p-4 mt-2 shadow">
          <h3 className="text-center m-4">Login Contact</h3>
          <br />
          <form onSubmit={(e) => submitForm(e)}>
            <div className="mb-2">
              <label htmlFor="Name" className="form-label">
                Mobile Number
              </label>
              <input
                type="text"
                className="form-control"
                placeholder="Enter Mobile Number*"
                name="Phone"
                value={phone}
                onChange={(e) => inputchanges(e)}
              />
            </div>
            <div className="mb-2">
              <label htmlFor="password" className="form-label">
                Password
              </label>
              <input
                type="text"
                className="form-control"
                placeholder="Enter Password*"
                name="Password"
                value={password}
                onChange={(e) => inputchanges(e)}
              />
            </div>
            <button type="submit" className="btn btn-outline-primary mx-2">
              Login
            </button>
            <button type="reset" className="btn btn-outline-danger mx-2">
              Forgot Password
            </button>
          </form>
        </div>
      </div>
    </div>
  );
}
export default Login;
